import React, { useState, useEffect } from "react";
import backgroundImage from "./assets/indexBG.png";
import "./styles/App.css";


function App() {
    return (
        <div className="indexBg">
            <h1>Welcome to Barangay App</h1>
            <p>This is where you will build your UI.</p>
        </div>
    );
}

export default App;
